(7, 'OEM', 'OEM stands for Original Equipment Manufacturer, a company that produces parts, components, or products that are used or sold by another company under its own brand or as part of its larger product. For example, Apollo Tyres making tires for a Honda car is an OEM relationship, as is a microprocessor company like Intel supplying chips to a computer manufacturer like Dell.', 'published', '2025-09-05 16:37:58', '2025-09-05 16:37:58'),
(8, 'Aftermarket', 'The automotive aftermarket is the secondary parts market of the automotive industry, concerned with the manufacturing, remanufacturing, distribution, retailing, and installation of all vehicle parts, chemicals, equipment, and accessories, after the sale of the automobile by the original equipment manufacturer (OEM) to the consumer. The parts, accessories, etc. for sale may or may not be manufactur', 'published', '2025-09-05 16:38:54', '2025-09-05 16:38:54');
